import React from 'react'
import Redirect from 'react-router-dom'

export const ProtectedRoute  = ({ component: Component, isAuthenticated: isAuthenticated, ...rest }) =>{
  <Route {...rest} render={(props) =>(
    isAuthenticated === true
    ? <Component {...props}/>
    : <Redirect to='/login'/>
  )}/>
}
